import React, { useState, useEffect } from 'react';
import { useLocation, Link } from 'react-router-dom';
import supabase from '../../supabaseClient';
import './DataEntry.css';

function DataEntry() {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);

  // Form state
  const [formData, setFormData] = useState({
    customerName: '',
    customerPhone: '',
    customerAadhar: '',
    customerPAN: '',
    destinationCountry: queryParams.get('country') || '',
    parcelWeight: queryParams.get('weight') || '',
    selectedCourier: queryParams.get('carrier') || '',
    selectedService: queryParams.get('service') || '',
    basePrice: parseFloat(queryParams.get('basePrice')) || 0,
    priceToCustomer: '',
    ourCost: '',
    status: 'Booked'
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState(false);
  // We're now using the real Supabase client, so no need for dev mode

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess(false);

    // Generate a booking ID (e.g., BOOK-001, BOOK-002)
    const timestamp = new Date().getTime();
    const bookingId = `BOOK-${timestamp.toString().slice(-6)}`;

    try {
      // Insert the booking into Supabase
      const { data, error } = await supabase
        .from('bookings')
        .insert([
          {
            booking_id: bookingId,
            booking_date: new Date().toISOString(),
            customer_name: formData.customerName,
            customer_phone: formData.customerPhone,
            customer_aadhar: formData.customerAadhar || null,
            customer_pan: formData.customerPAN || null,
            destination_country: formData.destinationCountry,
            parcel_weight: parseFloat(formData.parcelWeight),
            selected_courier: formData.selectedCourier,
            base_price: parseFloat(formData.basePrice),
            price_to_customer: parseFloat(formData.priceToCustomer),
            our_cost: parseFloat(formData.ourCost),
            status: formData.status,
            selected_service: formData.selectedService
          }
        ]);

      if (error) throw error;

      setSuccess(true);
      // Reset form after successful submission
      setFormData({
        customerName: '',
        customerPhone: '',
        customerAadhar: '',
        customerPAN: '',
        destinationCountry: '',
        parcelWeight: '',
        selectedCourier: '',
        selectedService: '',
        basePrice: '',
        priceToCustomer: '',
        ourCost: '',
        status: 'Booked'
      });
    } catch (err) {
      console.error('Error submitting booking:', err);
      setError('Failed to submit booking. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="data-entry-container">
      <header className="App-header">
        <h1>Booking Data Entry</h1>
        <p>Enter new booking information</p>
        <div className="navigation-buttons">
          <Link to="/" className="nav-button">Back to Home</Link>
        </div>
      </header>

      <main className="main-content">

        {success && (
          <div className="success-message">
            <p>✅ Booking submitted successfully!</p>
          </div>
        )}

        {error && (
          <div className="error-message">
            <p>❌ {error}</p>
          </div>
        )}

        <form onSubmit={handleSubmit} className="booking-form">
          <div className="form-section">
            <h3>Customer Information</h3>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="customerName">Customer Name*</label>
                <input
                  type="text"
                  id="customerName"
                  name="customerName"
                  value={formData.customerName}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="customerPhone">Phone Number*</label>
                <input
                  type="tel"
                  id="customerPhone"
                  name="customerPhone"
                  value={formData.customerPhone}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label htmlFor="customerAadhar">Aadhar Number (Optional)</label>
                <input
                  type="text"
                  id="customerAadhar"
                  name="customerAadhar"
                  value={formData.customerAadhar}
                  onChange={handleChange}
                />
              </div>
              <div className="form-group">
                <label htmlFor="customerPAN">PAN Number (Optional)</label>
                <input
                  type="text"
                  id="customerPAN"
                  name="customerPAN"
                  value={formData.customerPAN}
                  onChange={handleChange}
                />
              </div>
            </div>
          </div>

          <div className="form-section">
            <h3>Parcel Information</h3>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="destinationCountry">Destination Country*</label>
                <input
                  type="text"
                  id="destinationCountry"
                  name="destinationCountry"
                  value={formData.destinationCountry}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="parcelWeight">Parcel Weight (kg)*</label>
                <input
                  type="number"
                  id="parcelWeight"
                  name="parcelWeight"
                  value={formData.parcelWeight}
                  onChange={handleChange}
                  step="0.01"
                  min="0.01"
                  required
                />
              </div>
            </div>
          </div>

          <div className="form-section">
            <h3>Courier Information</h3>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="selectedCourier">Selected Courier*</label>
                <input
                  type="text"
                  id="selectedCourier"
                  name="selectedCourier"
                  value={formData.selectedCourier}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
          </div>

          <div className="form-section">
            <h3>Pricing Information</h3>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="basePrice">Base Price*</label>
                <input
                  type="number"
                  id="basePrice"
                  name="basePrice"
                  value={formData.basePrice}
                  onChange={handleChange}
                  step="0.01"
                  min="0"
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="priceToCustomer">Price to Customer*</label>
                <input
                  type="number"
                  id="priceToCustomer"
                  name="priceToCustomer"
                  value={formData.priceToCustomer}
                  onChange={handleChange}
                  step="0.01"
                  min="0"
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="ourCost">Our Cost*</label>
                <input
                  type="number"
                  id="ourCost"
                  name="ourCost"
                  value={formData.ourCost}
                  onChange={handleChange}
                  step="0.01"
                  min="0"
                  required
                />
              </div>
            </div>
          </div>

          <button type="submit" disabled={loading} className="submit-button">
            {loading ? 'Submitting...' : 'Submit Booking'}
          </button>
        </form>
      </main>

      <footer className="App-footer">
        <p>Built with ❤️ for efficient courier management</p>
      </footer>
    </div>
  );
}

export default DataEntry;
